import React, { Component } from "react";
import { Link } from "react-router-dom";

class Navbar extends Component {
  state = {
    Nav: [
      {
        name: "Discover",
        link: "/discover"
      },
      {
        name: "Movies",
        link: "/movies"
      },
      {
        name: "TV shows",
        link: "/tvshows"
      },
      {
        name: "People",
        link: "/people"
      },
      {
        name: "Genre",
        link: "/genre"
      }
    ]
  };

  render() {
    return (
      <div className="navbar">
        <nav>
          <ul>
            {this.state.Nav.map(nav => (
              <Link to={nav.link}>{nav.name}</Link>
            ))}
          </ul>
        </nav>
      </div>
    );
  }
}

export default Navbar;
